interface IsFISCOLD {
    function INDEX() external view returns ( uint );
}

contract wFISC is ERC20 {
    using SafeERC20 for ERC20;
    using Address for address;
    using SafeMath for uint;

    address public immutable sFISC;

    constructor( address _sFISC ) ERC20( 'Wrapped sFISC', 'wsFISC' ) {
        require( _sFISC != address(0) );
        sFISC = _sFISC;
    }

    /**
        @notice wrap sFISC
        @param _amount uint
        @return uint
     */
    function wrap( uint _amount ) external returns ( uint ) {
        IERC20( sFISC ).transferFrom( msg.sender, address(this), _amount );

        uint value = sFISCTowFISC( _amount );
        _mint( msg.sender, value );
        return value;
    }

    /**
        @notice unwrap sFISC
        @param _amount uint
        @return uint
     */
    function unwrap( uint _amount ) external returns ( uint ) {
        _burn( msg.sender, _amount );

        uint value = wFISCTosFISC( _amount );
        IERC20( sFISC ).transfer( msg.sender, value );
        return value;
    }

    /**
        @notice converts wFISC amount to sFISC
        @param _amount uint
        @return uint
     */
    function wFISCTosFISC( uint _amount ) public view returns ( uint ) {
        return _amount.mul( IsFISCOLD( sFISC ).INDEX() ).div( 10 ** decimals() );
    }

    /**
        @notice converts sFISC amount to wFISC
        @param _amount uint
        @return uint
     */
    function sFISCTowFISC( uint _amount ) public view returns ( uint ) {
        return _amount.mul( 10 ** decimals() ).div( IsFISCOLD( sFISC ).INDEX() );
    }

}
